import React from "react";
import Header from "./components/Header";

class App extends React.Component {

	componentDidUpdate(prevProp) {
		if (this.state.helpText !== "Help")
			console.log("Some")
	}

	render() {
		return (<div>
			<Header title="Список пользователей" />

		</div>)
	}

}

export default App
